import React from "react";

function Dashboard() {
  return (
    <div>
      <div
        style={{
          height: "40vh",
          width: "76vw",
          marginBottom: "3vh",
          marginLeft: "2vw",
          marginRight: "2vw",
          display: "flex",
          fontSize: "2em",
          fontWeight: "600",
          text
        }}
      >
        <div
          style={{
            height: "18vh",
            width: "20vw",
            marginTop: "15vh",
            marginLeft: "4vw",
            backgroundColor: "#FFFFFF",
            borderRadius: "10px",
            color: "#FF5D01",
          }}
        >
          <p>12 Quiz</p>
          <p>Created </p>
        </div>

        <div
          style={{
            height: "18vh",
            width: "20vw",
            marginTop: "15vh",
            marginLeft: "4vw",
            backgroundColor: "#FFFFFF",
            borderRadius: "10px",
            color: "#60B84B",
          }}
        >
          <p>12 Quiz</p>
          <p>Created </p>
        </div>

        <div
          style={{
            height: "18vh",
            width: "20vw",
            marginTop: "15vh",
            marginLeft: "4vw",
            backgroundColor: "#FFFFFF",
            borderRadius: "10px",
            color: "#5076FF",
          }}
        >
          <p>12 Quiz</p>
          <p>Created </p>
        </div>
      </div>
      <div
        style={{
          height: "60vh",
          width: "80vw",
          backgroundColor: "yellow",
        }}
      ></div>
    </div>
  );
}

export default Dashboard;
